import React from "react";
import {Link} from 'react-router-dom';


const Navbar =()=>{
    return (
        <nav>
            <div>
                <h1>Disctionary App</h1>
            </div>
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/history">History</Link>
                </li>
            </ul>
        </nav>
    )
}

export default Navbar;
